const UrlSorten = () => {
    return (
        <div class="container">
            <div><h1 className="page-title">URL Sorten</h1></div>
            <div>
                <span><input type="text" className="form-control" id="exampleFormControlInput1" placeholder="Shorten your link" /></span>
                <span><button className="btn btn-success">URL Sorten</button></span>
            </div>
        </div>
    )
}

export default UrlSorten
